n=a0.lI(a6,"1. Service Overview","Welcome to AssisMonter, a comprehensive transportation and assistance platform that connects customers with professional drivers who provide non-medical ride and support services for various daily activities.\n\nOur services include:\n\u2022 Transportation to and from various destinations (shopping, appointments, errands, airport)\n\u2022 Shopping assistance and support at retail locations, grocery stores, and pharmacies\n\u2022 Appointment accompaniment for non-medical visits (legal, banking, government offices)\n\u2022 General errand assistance (post office, DMV, community centers)\n\u2022 Airport transportation with luggage assistance and check-in support\n\u2022 Light assistance with bags and packages (up to 25 lbs)\n\nAssisMonter is not a medical transport provider. Our services are designed for individuals who can walk independently without assistance from the driver.")
k=a0.lI(a6,"2. Rider Requirements","By requesting a ride, you confirm that:\n\u2022 The rider is physically capable of walking to and from the vehicle without aid\n\u2022 No lifting or physical contact is required from the driver\n\u2022 No assistance is needed with medical devices (e.g., wheelchairs, walkers, oxygen tanks)\n\u2022 The rider can participate in shopping activities independently\n\u2022 The rider can communicate their needs clearly to the driver")
j=a0.lI(a6,"3. Driver Role","AssisMonter drivers are independent contractors who provide transportation and comprehensive assistance services. They are not caregivers, medical personnel, or aides. Their duties include:\n\u2022 Driving the rider safely to and from destinations\n\u2022 Providing shopping assistance and support:\n  - Loading or unloading shopping bags (\u2264 25 lbs each)\n  - Guiding customers to or from stores (without physical support)\n  - Verbal assistance and support during shopping activities\n  - Opening doors and pushing shopping carts\n\u2022 Offering appointment accompaniment:\n  - Waiting during appointments when requested\n  - Providing navigation assistance to and from locations\n  - Basic mobility support and guidance\n\u2022 Airport transportation assistance:\n  - Luggage assistance to terminal\n  - Check-in process support\n  - Escorting to TSA checkpoint\n\u2022 General errand support:\n  - Assistance at post office, DMV, pharmacy\n  - Light guidance and navigation help\n\u2022 Providing courteous and professional service throughout the journey")
i=a0.lI(a6,"4. Driver Restrictions","AssisMonter drivers are not permitted to:\n\u2022 Push wheelchairs or provide physical assistance\n\u2022 Administer medications or medical treatments\n\u2022 Escort passengers into medical offices or homes\n\u2022 Provide medical care, diagnosis, or treatment\n\u2022 Handle medical equipment or devices\n\u2022 Provide personal care services (bathing, dressing, etc.)\n\u2022 Enter private residences beyond the doorway")
h=a0.lI(a6,"5. Ride Conditions","All ride requests must include accurate pickup, destination, and drop-off locations.\n\nServices are available for various activities including shopping, appointments, errands, and airport transportation.\n\nRide services are only for riders who can safely enter and exit the vehicle on their own.\n\nDrivers may request assistance from the rider if needed for safety purposes.\n\nFor security and compliance, AssisMonter reserves the right to cancel a ride if the conditions above are not met.")
g=a0.lI(a6,"6. Liability & Disclaimer","AssistMonter and its drivers do not assume liability for:\n\u2022 Health or safety issues arising from a rider's medical condition\n\u2022 Accidents or injuries resulting from misuse of the service\n\u2022 Circumstances where a rider requires more care than declared\n\u2022 Personal property loss or damage during transportation\n\u2022 Delays due to traffic, weather, or other circumstances beyond our control\n\nBy using the service, the user agrees that:\n\u2022 AssisMonter is not a healthcare provider\n\u2022 All services are non-medical and non-emergency\n\u2022 Use of the app does not create a healthcare or caregiver relationship\n\u2022 Riders use the service at their own risk and agree to release AssisMonter, its affiliates, and its drivers from liability related to non-disclosed medical needs or service misuse.")
f=a0.lI(a6,"7. Cancellation & Refusal","AssistMonter drivers may refuse service if:\n\u2022 The rider appears unable to walk safely without support\n\u2022 The situation violates the terms of this agreement\n\u2022 There is a safety, legal, or ethical concern\n\u2022 The rider requires medical assistance beyond our scope\n\u2022 The rider is under the influence of drugs or alcohol\n\u2022 The rider behaves inappropriately or poses a safety risk")
e=a0.lI(a6,"8. Payment & Pricing","All rides and services must be paid for through the AssisMonter app using approved payment methods.\n\nNo service fees or commissions apply - drivers receive 100% of the payment.\n\nPrices are subject to change based on demand, distance, and service type. Users will be notified of any fare changes before booking.")
d=a0.lI(a6,"9. Privacy & Data","AssistMonter collects and processes personal data in accordance with our Privacy Policy.\n\nBy using our service, you consent to the collection and use of your information for service provision, safety, and improvement purposes.\n\nLocation data is collected only during active rides for safety and service quality purposes.")
c=a0.lI(a6,"10. Updates","AssistMonter reserves the right to update these Terms of Service at any time. Users will be notified of significant changes through the app or email.\n\nContinued use of the service after changes indicates acceptance of the new terms. It is the user's responsibility to review the updated terms regularly.")
